Please answer these questions before submitting your issue.  - Why do you submit this issue? - [ ] Question or discussion - [x] Bug - [ ] Requirement - [ ] Feature or performance improvement  ### Bug SkyWalking Version: 5.0.0-alpha OS: MacOs Sierra 10.12.1 JRE: 1.8.0_131  SkyWalking Web UI Bug：When I click the Application Menu, I have an occasional problem，Topological graph may Invalid；    Request： `http://127.0.0.1:8080/api/application` param： `{"variables":{"duration":{"start":"2018-03-13 1956","end":"2018-03-13 2056","step":"MINUTE"},"applicationId":"-1"},"query":"
  query Application($applicationId: ID!, $duration: Duration!) {
    getSlowService(applicationId: $applicationId, duration: $duration, topN: 10) {
      key: id
      name
      avgResponseTime
    }
    getServerThroughput(applicationId: $applicationId, duration: $duration, topN: 10) {
      key: id
      name
      callsPerSec
    }
    getApplicationTopology(applicationId: $applicationId, duration: $duration) {
      nodes {
        id
        name
        type
        ... on ApplicationNode {
          sla
          callsPerSec
          avgResponseTime
          apdex
          isAlarm
          numOfServer
          numOfServerAlarm
          numOfServiceAlarm
        }
      }
      calls {
        source
        target
        isAlert
        callType
        callsPerSec
        avgResponseTime
      }
    }
  }
"}`  Response： `{  "data": {   "getSlowService": [{    "key": "-3",    "name": "/test/queryTest",    "avgResponseTime": 876   }],   "getServerThroughput": [{    "key": "2",    "name": "by-test_130.30.184.150",    "callsPerSec": 0   }],   "getApplicationTopology": {    "nodes": [{     "id": "-1",     "name": "by-test",     "type": "SpringMVC",     "sla": 100,     "callsPerSec": 0,     "avgResponseTime": 876,     "apdex": 100,     "isAlarm": false,     "numOfServer": 1,     "numOfServerAlarm": 0,     "numOfServiceAlarm": 0    }, {     "id": "2",     "name": "rm-postgre.net:5544",     "type": "PostgreSQL"    }, {     "id": "1",     "name": "User",     "type": "USER"    }],    "calls": [{     "source": "-1",     "target": "2",     "isAlert": false,     "callType": "PostgreSQL",     "callsPerSec": 0,     "avgResponseTime": 69    }, {     "source": "1",     "target": "-1",     "isAlert": false,     "callType": "",     "callsPerSec": 0,     "avgResponseTime": 876    }]   }  } }`

Please answer these questions before submitting pull request  - Why submit this pull request? - [x] Bug fix - [ ] New feature provided - [ ] Improve performance  - Related issues  ___ ### Bug fix - Bug description. ```java http://localhost:8000/api/trace   {"variables":{"condition":{"traceId":"123","queryDuration":{"start":"2018-05-05 2302","end":"2018-05-05 2317","step":"MINUTE"},"paging":{"pageNum":1,"pageSize":20,"needTotal":true}}},"query":"
  query BasicTraces($condition: TraceQueryCondition) {
    queryBasicTraces(condition: $condition) {
      traces {
        key: segmentId
        operationName
        duration
        start
        isError
        traceIds
      }
      total
    }
  }
"} ``` this will return all traces in server.  ```java public TraceBrief queryBasicTraces(TraceQueryCondition condition) throws ParseException {         long startSecondTimeBucket = 0;         long endSecondTimeBucket = 0;         String traceId = Const.EMPTY_STRING;          if (StringUtils.isNotEmpty(condition.getTraceId())) {             traceId = condition.getTraceId();         } else if (nonNull(condition.getQueryDuration())) {             startSecondTimeBucket = DurationUtils.INSTANCE.startTimeDurationToSecondTimeBucket(condition.getQueryDuration().getStep(), condition.getQueryDuration().getStart());             endSecondTimeBucket = DurationUtils.INSTANCE.endTimeDurationToSecondTimeBucket(condition.getQueryDuration().getStep(), condition.getQueryDuration().getEnd());         } else {             throw new UnexpectedException("The condition must contains either queryDuration or traceId.");         }          long minDuration = condition.getMinTraceDuration();         long maxDuration = condition.getMaxTraceDuration();         String operationName = condition.getOperationName();         int applicationId = condition.getApplicationId();          PaginationUtils.Page page = PaginationUtils.INSTANCE.exchange(condition.getPaging());         return getSegmentTopService().loadTop(startSecondTimeBucket, endSecondTimeBucket, minDuration, maxDuration, operationName, traceId, applicationId, page.getLimit(), page.getFrom());     } ``` - How to fix?  ___ ### New feature or improvement - Describe the details and related test reports.
